import "./App.css";

function App() {
  return (
    <html>
      <head>
        <title>UPBEAT</title>
      </head>
      <div className="app">
        <h1
          style={
            <style>
              @import
              url('https://fonts.googleapis.com/css2?family=Playfair+Display:wght@700&display=swap');
            </style>
          }
        >
          UPBEAT
        </h1>
        UPBEAT
      </div>
    </html>
  );
}

export default App;
